DROP TABLE IF EXISTS `myTable`;

CREATE TABLE `myTable` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `Title` TEXT default NULL,
  `Position` TEXT default NULL,
  `CompanyId` TEXT default NULL,
  `Location` varchar(50) default NULL,
  `WorkCondition` TEXT default NULL,
  `WorkTime` varchar(255),
  `Description` TEXT default NULL,
  `ApplyLink` varchar(255),
  `AdLink` varchar(255),
  `AverageYearlySalary` mediumint default NULL,
  `JobNature` TEXT default NULL,
  `LastDate` varchar(255),
  `PostingDate` varchar(255),
  `SalaryRange` varchar(255),
  `Vacancy` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

